vices of any kind, does not operate vehicles utilized in the common carriage of passengers, and is not an aircraft operator.  Any travel operators utilizing vehicles in the common carriage of passengers which may carry passengers who have booked travel utilizing Airhub US LLC&rsquo;s software operate under appropriate FAA, DOT or other licensing or approvals.  In accordance with their licensure, these operators may be required to clearly identify the operator of the vehicle at the time of travel.  This may include a passenger briefing and/or conspicuous display of identifying information relative to the identity of the approved operator.  If there is any question as to the operator of the vehicle or aircraft, passengers should query the operator of the aircraft or vehicle prior to travel, or contact Airhub US LLC prior to travel and Airhub US LLC may be able to assist.  <br />\n<br />\nAirhub US LLC does not assist customers in booking or obtaining travel services from any private operators or operators not involved in the common carriage of passengers.  Any travel services obtained utilizing the &lsquo;crowd-sourcing&rsquo; services provided by Airhub US LLC provided by any operator who is not an approved commercial operator in the common carriage of passengers per DOT, FAA or other approvals, is not an authorized operator per Airhub US LLC&rsquo;s provided services.  Any offers for such services should be declined.  <br />\n<br />\nAirhub US LLC&#039;s entire liability, without exception, is limited to the customers&#039; reimbursement of the purchase price of the Software (maximum being the lesser of the amount paid by you and the suggested retail price as listed by Airhub US LLC ) in exchange for the return of the product, all copies, registration papers and manuals, and all materials that constitute a transfer of license from the customer back to Airhub US LLC.<br />\n<br />\n3.5 Warranties<br />\n<br />\nExcept as expressly stated in writing, Airhub US LLC makes no \r\nrepresentation or warranties in respect of this Software and expressly excludes all other warranties, expressed or implied, oral or written, including, without limitation, any implied warranties of merchantable quality or fitness for a particular purpose.<br />\n<br />\n3.6 Governing Law<br />\n<br />\nThis Agreement shall be governed by the law of the United States applicable therein. You hereby irrevocably attorn and submit to the non-exclusive jurisdiction of the courts of United States therefrom. If any provision shall be considered unlawful, void or otherwise unenforceable, then that provision shall be deemed severable from this License and not affect the validity and enforceability of any other provisions.<br />\n<br />\n3.7 Termination<br />\n<br />\nAny failure to comply with the terms and conditions of this Agreement will result in automatic and immediate termination of this license. Upon termination of this license granted herein for any reason, you agree to immediately cease use of Airhub 1.0 and destroy all copies of Airhub 1.0 supplied under this Agreement. The financial obligations incurred by you shall survive the expiration or termination of this license.<br />\n<br />\n4. DISCLAIMER OF WARRANTY<br />\n<br />\nTHIS SOFTWARE AND THE ACCOMPANYING FILES ARE SOLD &quot;AS IS&quot; AND WITHOUT WARRANTIES AS TO PERFORMANCE OR MERCHANTABILITY OR ANY OTHER WARRANTIES WHETHER EXPRESSED OR IMPLIED. THIS DISCLAIMER CONCERNS ALL FILES GENERATED AND EDITED BY Airhub 1.0 AS WELL.<br />\n<br />\n5. CONSENT OF USE OF DATA<br />\n<br />\nYou agree that Airhub US LLC may collect and use information gathered in any manner as part of the product support services provided to you, if any, related to Airhub 1.0.Airhub US LLC may also use this information to provide notices to you which may be of use or interest to you. Please refer to the privacy policy included herewith.','','2016-06-10 03:28:35','2016-06-10 21:24:08'),(3,3,'privacy','privacy',NULL,0.00,'','','Privacy Policy<br />\nLast updated: July 11, 2019<br />\n<br />\nAirhub (&quot;us&quot;, &quot;we&quot;, or &quot;our&quot;) operates the Airhub mobile application (the &quot;Service&quot;).<br />\nThis page informs you of our policies regarding the collection, use and disclosure of Personal Information when you use our Service.<br />\n<br />\nWe will not use or share your information with anyone except as described in this Privacy Policy.<br />\nWe use your Personal Information for providing and improving the Service. By using the Service, you agree to the collection and use of information in accordance with this policy. Unless otherwise defined in this Privacy Policy, terms used in this Privacy Policy have the same meanings as in our Terms and Conditions.<br />\n<br />\nInformation Collection And Use:<br />\nWhile using our Service, we may ask you to provide us with certain personally identifiable information that can be used to contact or identify you. Personally identifiable information may include, but is not limited to, your email address, name, phone number, postal address (&quot;Personal Information&quot;).<br />\n<br />\nWe collect this information for the purpose of providing the Service, identifying and communicating with you, responding to your requests/inquiries, servicing your purchase orders, and improving our services.<br />\n<br />\nLog Data:<br />\nWhen you access the Service by or through a mobile device, we may collect certain information automatically, including, but not limited to, the type of mobile device you use, your mobile device unique ID, the IP address of your mobile device, your mobile operating system, the type of mobile Internet browser you use and other statistics (&quot;Log Data&quot;).<br />\n<br />\nIn addition, we may use third party services such as Google Analytics that collect, monitor and analyze this type of information in order to increase our Service&#039;s functionality. These third party service providers have their own privacy policies addressing how they use such information.<br />\n<br />\nCookies:<br />\nCookies are files with a small amount of data, which may include an anonymous unique identifier. Cookies are sent to your browser from a web site and transferred to your device. We use cookies to collect information in order to improve our services for you.<br />\n<br />\nYou can instruct your browser to refuse all cookies or to indicate when a cookie is being sent. The Help feature on most browsers provide information on how to accept cookies, disable cookies or to notify you when receiving a new cookie.<br />\n<br />\nIf you do not accept cookies, you may not be able to use some features of our Service and we recommend that you leave them turned on.<br />\n<br />\nDo Not Track Disclosure:<br />\nWe do not support Do Not Track (&quot;DNT&quot;). Do Not Track is a preference you can set in your web browser to inform websites that you do not want to be tracked.<br />\nYou can enable or disable Do Not Track by visiting the Preferences or Settings page of your web browser.<br />\n<br />\nService Providers:<br />\nWe may employ third party companies and individuals to facilitate our Service, to provide the Service on our behalf, to perform Service-related services and/or to assist us in analyzing how our Service is used.<br />\n<br />\nThese third parties have access to your Personal Information only to perform specific tasks on our behalf and are obligated not to disclose or use your information for any other purpose.<br />\nCompliance With Laws<br />\n<br />\nWe will disclose your Personal Information where required to do so by law or subpoena or if we believe that such action is necessary to comply with the law and the reasonable requests of law enforcement or to protect the security or integrity of our Service.<br />\nBusiness Transaction<br />\n<br />\nIf Airhub is involved in a merger, acquisition or asset sale, your Personal Information may be transferred as a business asset. In such cases, we will provide notice before your Personal Information is transferred and/or becomes subject to a different Privacy Policy.<br />\n<br />\nSecurity:<br />\nThe security of your Personal Information is important to us, and we strive to implement and maintain reasonable, commercially acceptable security procedures and practices appropriate to the nature of the information we store, in order to protect it from unauthorized access, destruction, use, modification, or disclosure.<br />\nHowever, please be aware that no method of transmission over the internet, or method of electronic storage is 100% secure and we are unable to guarantee the absolute security of the Personal Information we have collected from you.<br />\n<br />\nInternational Transfer:<br />\nYour information, including Personal Information, may be transferred to &mdash; and maintained on &mdash; computers located outside of your state, province, country or other governmental jurisdiction where the data protection laws may differ than those from your jurisdiction.<br />\nIf you are located outside the United States and choose to provide information to us, please note that we transfer the information, including Personal Information, to the United States and process it there.<br />\n<br />\nYour consent to this Privacy Policy followed by your submission of such information represents your agreement to that transfer.<br />\n<br />\nLinks To Other Sites:<br />\nOur Service may contain links to other sites that are not operated by us. If you click on a third party link, you will be directed to that third party&#039;s site. We strongly advise you to review the Privacy Policy of every site you visit.<br />\n<br />\nWe have no control over, and assume no responsibility for the content, privacy policies or practices of any third party sites or services.<br />\n<br />\nChildren&#039;s Privacy:<br />\nOnly persons age 18 or older have permission to access our Service. Our Service does not address anyone under the age of 13 (&quot;Children&quot;).<br />\n<br />\nWe do not knowingly collect personally identifiable information from children under 13. If you are a parent or guardian and you learn that your Children have provided us with Personal Information, please contact us. If we become aware that we have collected Personal Information from children under age 13 without verification of parental consent, we take steps to remove that information from our servers.<br />\n<br />\nChanges To This Privacy Policy:<br />\nThis Privacy Policy is effective as of July 11, 2019 and will remain in effect except with respect to any changes in its provisions in the future, which will be in effect immediately after being posted on this page.<br />\n<br />\nWe reserve the right to update or change our Privacy Policy at any time and you should check this Privacy Policy periodically. Your continued use of the Service after we post any modifications to the Privacy Policy on this page will constitute your acknowledgment of the modifications and your consent to abide and be bound by the modified Privacy Policy.<br />\nIf we make any material changes to this Privacy Policy, we will notify you either through the email address you have provided us, or by placing a prominent notice on our website.<br />\n<br />\nContact Us:<br />\nIf you have any questions about this Privacy Policy, please contact us.','','2016-06-10 18:07:39','2019-07-12 19:22:40');
